import React from "react";
import vercelOGPagesPlugin from "@cloudflare/pages-plugin-vercel-og";

interface OgImageProps {
  ogTitle: string;
}

const OgImage = ({ ogTitle }: OgImageProps): JSX.Element => {
  return (
    <div
      style={{
        height: "100%",
        width: "100%",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#713f12",
        fontSize: 20,
        fontWeight: 600,
        padding: "24px",
        color: "rgb(0,0,0,.7)",
      }}
    >
      <div
        style={{
          height: "100%",
          width: "100%",
          display: "flex",
          flexDirection: "column",
          justifyContent: "space-between",
          backgroundColor: "#fefce8",
          fontWeight: 600,
          borderRadius: "16px",
          paddingRight: "48px",
          paddingLeft: "48px",
        }}
      >
        <h1>{ogTitle}</h1>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-between",
            alignItems: "center",
          }}
        >
          <h2
            style={{
              display: "flex",
              flexDirection: "row",
              alignItems: "center",
              fontSize: 24,
              gap: 10,
            }}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              xmlns:xlink="http://www.w3.org/1999/xlink"
              id="body_1"
              width="44"
              height="44"
            >
              <g transform="matrix(1.3333334 0 0 1.3333334 0 0)">
                <image
                  x="0"
                  y="0"
                  xlink:href="data:image/png;base64,"
                  preserveAspectRatio="none"
                  width="32"
                  height="32"
                />
              </g>
            </svg>
            ゆっきー
          </h2>
          <h2 style={{ color: "#713f12", fontFamily: "Reggae One" }}>
            ゆっきーの砂場
          </h2>
        </div>
      </div>
    </div>
  );
};
const getFontData = async (url: string): Promise<ArrayBuffer> => {
  const css = await (
    await fetch(url, {
      headers: {
        "User-Agent":
          "Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_6_8; de-at) AppleWebKit/533.21.1 (KHTML, like Gecko) Version/5.0.5 Safari/533.21.1",
      },
    })
  ).text();
  const resource = css.match(
    /src: url\((.+)\) format\('(opentype|truetype)'\)/
  );
  if (resource === null) {
    throw new Error("Font resource not found");
  }

  return await fetch(resource[1]).then(async (res) => await res.arrayBuffer());
};

export const onRequest = async () => {
  const notoSansJpUrl = `https://fonts.googleapis.com/css2?family=Noto+Sans+JP:wght@600`;
  const reggeaeOneUlr =
    "https://fonts.googleapis.com/css2?family=Reggae+One&display=swap&text=ゆっきーの砂場";
  const notoSansJpFontData = await getFontData(notoSansJpUrl);
  const reggeaeOneFontData = await getFontData(reggeaeOneUlr);
  return vercelOGPagesPlugin<OgImageProps>({
    imagePathSuffix: "/og-image.png",
    component: ({ ogTitle }) => {
      return <OgImage ogTitle={ogTitle} />;
    },
    extractors: {
      on: {
        'meta[property="og:title"]': (props) => ({
          element(element) {
            props.ogTitle = element.getAttribute("content");
          },
        }),
      },
    },
    options: {
      width: 800,
      height: 400,
      fonts: [
        {
          name: "Noto Sans JP",
          data: notoSansJpFontData,
          style: "normal",
        },
        {
          name: "Reggae One",
          data: reggeaeOneFontData,
          style: "normal",
        },
      ],
    },
    autoInject: {
      openGraph: true,
    },
  });
};
